" 56 :   @Override
 57 :   public void process(Node externs, Node root) {
 58 :     List<Reducer> reducers = ImmutableList.of(new ReturnConstantReducer(),
 59 :                                               new GetterReducer(),
 60 :                                               new SetterReducer(),
 61 :                                               new EmptyFunctionReducer(),
 62 :                                               new IdentityReducer());
 63 : 
 64 :     Multimap<Reducer, Reduction> reductionMap = HashMultimap.create();
 65 : 
 66 :     // Accumulate possible reductions in the reduction multi map.  They
 67 :     // will be applied in the loop below.
 68 :     NodeTraversal.traverse(compiler, root,
 69 :                            new ReductionGatherer(reducers, reductionMap));
 70 : 
 71 :     // Apply reductions iff they will provide some savings.
 72 :     for (Reducer reducer : reducers) {
 73 :       Collection<Reduction> reductions = reductionMap.get(reducer);
 74 :       if (reductions.isEmpty()) {
 75 :         continue;
 76 :       }
 77 : 
 78 :       Node helperCode = parseHelperCode(reducer);
 79 :       if (helperCode == null) {
 80 :         continue;
 81 :       }
 82 : 
 83 :       int helperCodeCost = InlineCostEstimator.getCost(helperCode);
 84 : 
 85 :       // Estimate savings
 86 :       int savings = 0;
 87 :       for (Reduction reduction : reductions) {
 88 :         savings += reduction.estimateSavings();
 89 :       }
 90 : 
 91 :       // Compare estimated savings against the helper cost.  Apply
 92 :       // reductions if doing so will result in some savings.
 93 :       if (savings > (helperCodeCost + SAVINGS_THRESHOLD)) {
 94 :         for (Reduction reduction : reductions) {
 95 :           reduction.apply();
 96 :         }
 97 : 
 98 :         Node addingRoot = compiler.getNodeForCodeInsertion(null);
 99 :         addingRoot.addChildrenToFront(helperCode);
100 :         compiler.reportCodeChange();
101 :       }
102 :     }
103 :   }"

